"258734":{"id":"258734","name":"Espiões da Máfia","slug":"espioes-da-mafia","original_title":"Mafia Spies","overview":"Espiões, gângsters, amantes, Sinatra, JFK e até James Bond. Incrível, mas verdadeira, Mafia Spies conta a história da escandalosa conspiração entre a CIA e a máfia para assassinar Fidel Castro.","first_air_date":"2024-07-16","episode_run_time":0,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["CreativeChaos vmg","Danny Strong Productions","See It Now Studios","Jackson Pictures"],"genres":["Documentário","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/mo8oTl1S3UDQBuTZNMulPtAyI2J.jpg","poster_path":"https://image.tmdb.org/t/p/original/wjOh8g1FhfBYXOog8p9cfBSbUhf.jpg","cast":["Douglas Vermeeren","Nick Annunziata","John Zacchino","Robert Davi","Rachel Comeau"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4quAqcrFGv8bnMnC7P70tk0cfxp.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4quAqcrFGv8bnMnC7P70tk0cfxp.jpg","air_date":"2024-07-16","episode_count":6,"overview":"N/A","vote_average":4.8,"episodes":{"1":{"name":"O Jogo","overview":"A revolução marca o fim do jogo para a máfia em Havana. Um novo jogo começa para a CIA, que recebe ordens presidenciais de \"eliminar\" Fidel Castro.","air_date":"2024-07-16","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/xr0XKb5sO7fqwnEjkYSycKKxnAN.jpg","vote_average":1},"2":{"name":"Os Traidores","overview":"A CIA começa a trabalhar com uma galeria de personagens pitorescos em sua tentativa de \"eliminar\" o líder cubano Fidel Castro. Entre eles destaca-se o lendário mafioso \"Johnny o Bonito\" Roselli.","air_date":"2024-07-16","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/b4YsPKtgQe9PpHS04TnwUeLmF1a.jpg","vote_average":6},"3":{"name":"A Preparação","overview":"A vida privada de Sam Giancana, gângster da máfia de Chicago e espião, atrai a atenção do FBI e da imprensa justo quando a CIA prepara sua invasão ultrassecreta de Cuba na Baía dos Porcos.","air_date":"2024-07-16","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/wgtA2AEZggPsnhOaatdTSr00Vrg.jpg","vote_average":5.5},"4":{"name":"A Ação","overview":"Diante da humilhação política, os Kennedy intensificam sua trama contra Castro. Enquanto isso, as coisas se tornam pessoais para o espião gângster Johnny Roselli, que decide agir.","air_date":"2024-07-16","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/3lRG89boUU4EZydMS3iUg8HoUCx.jpg","vote_average":5.5},"5":{"name":"O Espetáculo","overview":"O conflito entre os Estados Unidos e Castro se intensifica quando as ações da CIA em Cuba levam a um confronto com a Rússia. Roselli é confrontado com notícias de uma tragédia em Dallas.","air_date":"2024-07-16","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/wLhGn966ILZ9DnryyvyCtvjyuEG.jpg","vote_average":5.5},"6":{"name":"Consequências","overview":"\"Se falar, morre\". Johnny Roselli, Sam Giancana e a CIA enfrentam as consequências de seu escandaloso envolvimento nos planos de assassinato de Castro.","air_date":"2024-07-16","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/9XYNMPpZ6P86RJhBCAU3C2SKadp.jpg","vote_average":5.5}}}}},
