"90257":{"id":"90257","name":"Pequenos Incêndios por Toda Parte","slug":"pequenos-incendios-por-toda-parte","original_title":"Little Fires Everywhere","overview":"Um encontro entre duas famílias completamente diferentes vai afetar a vida de todos. A dona de casa perfeita Elena Richardson aluga a casa de hóspedes à Mia Warren , uma artista solteira e enigmática que se muda para Shaker Heights com sua filha adolescente. Em pouco tempo, as duas se tornam mais do que meras inquilinas: todos os quatro filhos da família Richardson se encantam com as novas moradoras de Shaker. Porém, Mia carrega um passado misterioso e um desprezo pelo status quo que ameaça desestruturar uma comunidade tão cuidadosamente ordenada.","first_air_date":"2020-03-18","episode_run_time":60,"vote_average":7.619,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Liz Tigelaar"],"production_companies":["Hello Sunshine","Simpson Street","ABC Signature Studios"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/mTkp5yL7TNqBHhfUOmj3NvGfYR8.jpg","poster_path":"https://image.tmdb.org/t/p/original/aSR8m64Eqxcbyb1G7uWwiwii3WY.jpg","cast":["Kerry Washington","Reese Witherspoon","Joshua Jackson","Rosemarie DeWitt","Jade Pettyjohn"],"trailer":"Ym1mqSXEOW8","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wuVngWpJNrhojvkbYibosycSUKy.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wuVngWpJNrhojvkbYibosycSUKy.jpg","air_date":"2020-03-18","episode_count":8,"overview":"N/A","vote_average":8.1,"episodes":{"1":{"name":"A Faísca","overview":"A vida da aparentemente perfeita família Richardson é afetada pela chegada da misteriosa artista Mia Warren e sua filha Pearl em Shaker Heights, Ohio – uma cidade bucólica fundada nos princípios utópicos da harmonia e da ordem.","air_date":"2020-03-18","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/P3L7n07BXELlNig9dlLUaQC7A6.jpg","vote_average":8.026},"2":{"name":"Com Semente e Tudo","overview":"À medida em quem a amizade de Moody com a Pearl se intensifica, o relacionamento de Elena e Mia cresce cada vez mais. Incomodada com uma referência falsa, Elena bisbilhota o passado de Mia, enquanto Lexie se preocupa com a redação para admissão na Yale.","air_date":"2020-03-18","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/pq0IFO7VMPWFxjKuzvKUrILFb39.jpg","vote_average":8.45},"3":{"name":"Setenta Centavos","overview":"Os preparativos para a primeira festa de aniversário de Mirabelle McCullough estão em andamento, enquanto Mia ajuda Bebe a procurar sua filha. Para a tristeza de Pearl, Moody tenta dar o próximo passo na relação no Baile de volta às aulas, enquanto Izzy envia uma mensagem para April.","air_date":"2020-03-18","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/jTcsmakWh6fefzvNwjDQ5xZtSNy.jpg","vote_average":8.1},"4":{"name":"A Teia de Aranha","overview":"Moody fica com ciúmes da amizade entre Pearl e Lexie, enquanto Lexie curte seu novo status sexualmente ativo com Brian. Inspirada por Lexie, Pearl explora sua sexualidade e começa a observar Trip.","air_date":"2020-03-25","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/2fK7LumQKzivLT0KFwmIqtmJfe.jpg","vote_average":7.688},"5":{"name":"Duo","overview":"Bill Richardson enfrenta muito trabalho para representar os McCulloughs no processo pela custódia, para a decepção de Izzy. Lexie faz uma descoberta muito desagradável e pede ajuda à Pearl.","air_date":"2020-04-01","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/2KIxosp4uOKkNL28VrkOmzYdO4i.jpg","vote_average":7.625},"6":{"name":"O Inquietante","overview":"Em 1981, a jovem Mia inicia seus estudos na Escola de Artes Visuais na cidade de Nova Iorque, onde conhece a cativante fotógrafa Pauline Hawthorne. Com dificuldades para pagar suas despesas, Mia toma uma decisão que muda o rumo de sua vida inteira.","air_date":"2020-04-08","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/kCiUFOQz35T3JJPpeyQ00Iqupd3.jpg","vote_average":7.6},"7":{"name":"Foto Perfeita","overview":"Mia, Bebe e o advogado Ed Lan preparam o caso contra os McCulloughs. Izzy se aproxima de Mia para adquirir experiência, enquanto seu relacionamento com Elena chega a um momento de tensão.","air_date":"2020-04-15","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/k8Q60wAYBFUm4B2k72omfuSP5MU.jpg","vote_average":8.824},"8":{"name":"Encontrar um Jeito","overview":"Elena faz uma revelação bombástica à Pearl e coloca em risco a relação entre Pearl e sua mãe. Moody se sente traído quando descobre o segredo de Trip e Pearl.","air_date":"2020-04-22","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/vOHqw28dKsHoQxeTt35D27czsGI.jpg","vote_average":8.176}}}}},
